import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Card from './components/Card'


export default function Priority1()
{
  const [array, setarray] = useState([]);
  const [data, setData] = useState(null);
  const [card_list_Urgent, setcard_list_Urgent] = useState([]) 
  const [card_list_High, setcard_list_High] = useState([])
  const [card_list_Medium, setcard_list_Medium] = useState([])
  const [card_list_Low, setcard_list_Low] = useState([])
  const [card_list_Nopriority, setcard_list_Nopriority] = useState([])

  const fetchData = async () => {
    try {
      const response = await axios.get('https://api.quicksell.co/v1/internal/frontend-assignment');
      setData(response.data.tickets);
    } catch (error) {
      console.error('Axios error:', error);
    }
  };

  const add_card = () => {
    const newArray = [...array];
    const newcardlist_Urgent=[...card_list_Urgent];
    const newcardlist_High=[...card_list_High];
    const newcardlist_Medium=[...card_list_Medium];
    const newcardlist_Low=[...card_list_Low];
    const newcardlist_Nopriority=[...card_list_Nopriority];


    for (const item of data) {
   
        if(item.priority==0)
        {
        newcardlist_Nopriority.push(<Card name={item.id} desc={item.title}></Card>)
        newArray.push(item);
        }
   
   
   
   
   
    }
    setarray(newArray);
    setcard_list_Nopriority(newcardlist_Nopriority);
  };

  useEffect(() => {
    fetchData();
  }, []);

  useEffect(() => {
    if (data) {
      add_card();
    }
  }, [data]);

  console.log('array', array);



